import React from "react";
import { Form, Button, Col, Row, Container } from "react-bootstrap";
import Formulas from "./Formulas.PNG"

function SCTFormulas() {
    return (
        <Col sm={4}><img src={Formulas} /></Col>
    )
};

export default SCTFormulas
